import axios from "axios"

export async function login(email, password) {
    const config = {
        "Content-Type": "application/json",
    }
    try {
        const res = await axios.post(
            "api/auth/login",
            {
                email,
                password,
            },
            config
        )

        return res.data
    } catch (error) {
        console.log("Error.")
    }
}
